    // // Function to bulk populate tokens for a single color
    // function bulkPopulateTokens(uint256[][] memory tokenData, string memory color) external {

    //     // LibDiamond.enforceIsContractOwner();

    //     // require(s.gemTokenValidColors[color], "Invalid Color");

